import './App.css';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';
import Sidebar from "./components/nav_bars/Sidebar";
import CreateAircraftComponent from "./components/add_components/CreateAircraftComponent";
import CreateCompanyComponent from "./components/add_components/CreateCompanyComponent";
import CreateEmployeeComponent from "./components/add_components/CreateEmployeeComponent";
import CreateFlightComponent from "./components/add_components/CreateFlightComponent";
import CreateClientComponent from "./components/add_components/CreateClientComponent";
import SearchEmployeeComponent from "./components/main_components/home/SearchEmployeeComponent";
import SearchFlightComponent from "./components/main_components/home/SearchFlightComponent";
import DepartureFlightComponent from "./components/main_components/flight/DepartureFlightComponent";
import ArrivalFlightsComponent from "./components/main_components/flight/ArrivalFlightsComponent";
import SearchAircraftComponent from "./components/main_components/flight/SearchAircraftComponent";
import SearchCompaniesComponent from "./components/main_components/companies/SearchCompaniesComponent";
import SearchClientsComponent from "./components/main_components/clients/SearchClientsComponent";
import TestMainPage from "./components/TestMainPage";
import MaterialUIPickers from "./components/add_components/MaterialUIPickers";
import LocalizationProvider from "@mui/lab/LocalizationProvider";
import AdapterDateFns from "@mui/lab/AdapterDateFns";
import Stack from "@mui/material/Stack";
import DesktopDatePicker from "@mui/lab/DesktopDatePicker";
import TextField from "@mui/material/TextField";
import MobileDatePicker from "@mui/lab/MobileDatePicker";
import TimePicker from "@mui/lab/TimePicker";
import DateTimePicker from "@mui/lab/DateTimePicker";
import * as React from "react";


function App() {
    const [value, setValue] = React.useState(new Date('2014-08-18T21:11:54'));

    const handleChange = (newValue) => {
        setValue(newValue);
    };
    return (
        // <Router>
        //     <Sidebar/>
        //     <Switch>
        //         <Route exact path='/' component={TestMainPage}/>
        //         <Route exact path='/home/search-for-employee' component={SearchEmployeeComponent}/>
        //         <Route path='/home/search-for-flight' exact component={SearchFlightComponent}/>
        //         <Route path='/flight/departure-flight' exact component={DepartureFlightComponent}/>
        //         <Route path='/flight/arrival-flight' exact component={ArrivalFlightsComponent}/>
        //         <Route path='/flight/aircraft' exact component={SearchAircraftComponent}/>
        //         <Route path='/clients' exact component={SearchClientsComponent}/>
        //         <Route path='/companies' exact component={SearchCompaniesComponent}/>
        //         <Route path='/add-new-flight' exact component={CreateFlightComponent}/>
        //         <Route path='/add-new-aircraft' exact component={CreateAircraftComponent}/>
        //         <Route path='/add-new-employee' exact component={CreateEmployeeComponent}/>
        //         <Route path='/add-new-company' exact component={CreateCompanyComponent}/>
        //         <Route path='/add-new-client' exact component={CreateClientComponent}/>
        //     </Switch>
        // </Router>
        <LocalizationProvider dateAdapter={AdapterDateFns}>
            <Stack spacing={3}>
                <DesktopDatePicker
                    label="Date desktop"
                    inputFormat="MM/dd/yyyy"
                    value={value}
                    onChange={handleChange}
                    renderInput={(params) => <TextField {...params} />}
                />
                <MobileDatePicker
                    label="Date mobile"
                    inputFormat="MM/dd/yyyy"
                    value={value}
                    onChange={handleChange}
                    renderInput={(params) => <TextField {...params} />}
                />
                <TimePicker
                    label="Time"
                    value={value}
                    onChange={handleChange}
                    renderInput={(params) => <TextField {...params} />}
                />
                <DateTimePicker
                    label="Date&Time picker"
                    value={value}
                    onChange={handleChange}
                    renderInput={(params) => <TextField {...params} />}
                />
            </Stack>
        </LocalizationProvider>
    );
}


export default App;
